import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import MovieDetails from './MovieDetails';  // Make sure MovieDetails is imported
import Search from './pages/Search';        // Assuming you have a Search page
import Watchlist from './pages/Watchlist';  // Assuming you have a Watchlist page

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/movie/:id" element={<MovieDetails />} /> {/* This route is for Movie Details */}
        <Route path="/search" element={<Search />} />
        <Route path="/watchlist" element={<Watchlist />} />
      </Routes>
    </Router>
  );
};

export default App;
